import React, { useState } from "react";

const times = new Date().toLocaleTimeString();



const App = () => {
    
    const [time, setTime] = useState(times)
    setTime(time + times)
    return(
        <>
            <h1>{times}</h1>
            <button onClick={time}> Get Time </button> 
        </>
    )
}

export default App;
